import React from 'react';
import './App.css';
import HomePage from './pages/homepage/homepage.container';
import {Route} from 'react-router-dom';

const HatsPage = () =>(
  <div>HI</div>
)

const App =()=> (
    <div>
      <Route exact path="/" component={HomePage}/>
      <Route exact path="/hats" component={HatsPage}/>
    </div>
);


export default App;
